import "isomorphic-fetch";

const Home = () => (
  <>
    <h1>Hello, World!</h1>
    <p>This is a simple "test" using nextjs</p>
  </>
);

Home.getInitialProps = async () => {
  const res = await fetch("https://api.github.com/users/MrDougz/repos");
  const repos = await res.json();

  return {};
};

export default Home;
